import React from 'react'
import rootSaga from '../saga/sagas';

const GetSong = () => {
    const songs = useSelector((state: rootState) => state.songs.songs);

  return (
    <div>
      <h1>
        {songs?.map((item, index) => (
          <li key={index}>{item.artist}</li>
        ))}
      </h1>
    </div>
  )
}

export default GetSong
